MILFHunter - Kitana in Bait and Switch


Kitana wanted to buy a starter kit fishing set for her 10 year old and I was lucky enough to be in the bait shop copping a crab trap. Soon as I saw she needed help, I cut off the store clerk and gave her all the assistance she needed. I told her it would be best if she learned how to use the equipment first so that she would be able to teach her son since Daddy wasnt around. She fell for it hook, line and sinker. We went back to my place and I put my rod into her fish basket, played with her huge bobbers and spanked her great big puerto rican ass. This one is a cant miss



